import React from "react";
import "./workout.css";

class Workout extends React.Component {
	constructor(props) {
		super(props);

		this.state = {
			workouts: [
				{ id: 1, name: "Workout 1", lastWorkout: new Date(2020, 10, 10), sets: [{ exerciseId: 1, exerciseName: "Hanging Knee Raise", goalReps: 15, rest: 180 }, { exerciseId: 1, name: "Hanging Knee Raise", goalReps: 15, rest: 180 }] },
				{ id: 2, name: "Workout 2", sets: [{ exerciseId: 1, exerciseName: "Hanging Knee Raise", goalReps: 15, rest: 180 }, { exerciseId: 1, name: "Hanging Knee Raise", goalReps: 15, rest: 180 }] },
				{ id: 3, name: "Workout 3", lastWorkout: new Date(2020, 10, 10), sets: [{ exerciseId: 1, exerciseName: "Hanging Knee Raise", goalReps: 15, rest: 180 }, { exerciseId: 1, name: "Hanging Knee Raise", goalReps: 15, rest: 180 }] },
				{ id: 4, name: "Workout 4", lastWorkout: new Date(2020, 10, 10), sets: [{ exerciseId: 1, exerciseName: "Hanging Knee Raise", goalReps: 15, rest: 180 }, { exerciseId: 1, name: "Hanging Knee Raise", goalReps: 15, rest: 180 }] },
				{ id: 5, name: "Workout 5", lastWorkout: new Date(2020, 10, 10), sets: [{ exerciseId: 1, exerciseName: "Hanging Knee Raise", goalReps: 15, rest: 180 }, { exerciseId: 1, name: "Hanging Knee Raise", goalReps: 15, rest: 180 }] },
				{ id: 6, name: "Workout 6", lastWorkout: new Date(2020, 10, 10), sets: [{ exerciseId: 1, exerciseName: "Hanging Knee Raise", goalReps: 15, rest: 180 }, { exerciseId: 1, name: "Hanging Knee Raise", goalReps: 15, rest: 180 }] },
				{ id: 7, name: "Workout 7", lastWorkout: new Date(2020, 10, 10), sets: [{ exerciseId: 1, exerciseName: "Hanging Knee Raise", goalReps: 15, rest: 180 }, { exerciseId: 1, name: "Hanging Knee Raise", goalReps: 15, rest: 180 }] },
				{ id: 8, name: "Workout 8", lastWorkout: new Date(2020, 10, 10), sets: [{ exerciseId: 1, exerciseName: "Hanging Knee Raise", goalReps: 15, rest: 180 }, { exerciseId: 1, name: "Hanging Knee Raise", goalReps: 15, rest: 180 }] },
				{ id: 9, name: "Workout 9", lastWorkout: new Date(2020, 10, 10), sets: [{ exerciseId: 1, exerciseName: "Hanging Knee Raise", goalReps: 15, rest: 180 }, { exerciseId: 1, name: "Hanging Knee Raise", goalReps: 15, rest: 180 }] },
				{ id: 10, name: "Workout 10", lastWorkout: new Date(2020, 10, 10), sets: [{ exerciseId: 1, exerciseName: "Hanging Knee Raise", goalReps: 15, rest: 180 }, { exerciseId: 1, name: "Hanging Knee Raise", goalReps: 15, rest: 180 }] }
				]
		};
	}

	render() {
		return (
			<div className="page workoutPage">
				{
				this.state.workouts.map(workout => (
				<div className="card">
					<div className="cardContainer">
						<div className="cardIcon">{ workout.sets.reduce((total, current) => total + current, 0) }</div>
						<div className="cardContent">
							<div className="cardHeader">{ workout.name }</div>
							<div className="cardSubHeader">{ workout.lastWorkout ? workout.lastWorkout.toLocaleDateString() : "Not Started" }</div>
						</div>
					</div>
				</div>
				))
				}
			</div>
		);
	}
}

export default Workout;
